import * as React from 'react';
import Masonry from 'react-masonry-component';
import { MDBCard, MDBCardBody, MDBCardImage,MDBCardTitle,MDBCardText,MDBBtn,MDBCol} from "mdbreact";

const masonryOptions = {
    transitionDuration: 0
};

const imagesLoadedOptions = { background: '.my-bg-image-el' }
const theData = [
  {
      name: 'Sam',
      email: 'somewhere@gmail.com'
  },
  {
    name: 'Sam',
    email: 'somewhere@gmail.com'
},  {
  name: 'Sam',
  email: 'somewhere@gmail.com'
},  {
  name: 'Sam',
  email: 'somewhere@gmail.com'
},  {
  name: 'Sam',
  email: 'somewhere@gmail.com'
},

]
class Services extends React.Component {
    render() {
        const childElements = theData.map((e,i)=>{
           return (
                <li className="image-element-class">
                  
      <MDBCard style={{ width: "20rem",marginRight: "12px",marginLeft: "12px",}}>
        <MDBCardImage className="img-fluid" src="https://mdbootstrap.com/img/Photos/Others/images/43.jpg" waves />
        <MDBCardBody>
          <MDBCardTitle>Card title</MDBCardTitle>
          <MDBCardText>
            Some quick example text to build on the card title and make
            up the bulk of the card&apos;s content.
          </MDBCardText>
          <MDBBtn href="#">MDBBtn</MDBBtn>
        </MDBCardBody>
      </MDBCard>
                    data{e.name}
                    <img src={e.name} />
                </li>
            );
        });
    
        return (
<div style={{maxWidth:"",marginLeft:"auto",marginRight:"auto",paddingTop:"72px",background:"url(http://lmgexhibitions.kilaqitu.com/img/mb1.png) no-repeat top fixed",backgroundSize: "cover"}}>
  <MDBCard style={{maxWidth:"800",marginLeft:"auto",marginRight:"auto"}} color="white" text="black" className="text-center">
    <MDBCardBody>
      <Masonry
                className={'my-gallery-class'} // default ''
                elementType={'div'} // default 'div'
                options={masonryOptions} // default {}
                disableImagesLoaded={false} // default false
                updateOnEachImageLoad={false} // default false and works only if disableImagesLoaded is false
                imagesLoadedOptions={imagesLoadedOptions} // default {}
                style={{maxWidth:"800",marginLeft:"auto",marginRight:"auto"}}
            >
                {childElements}
        </Masonry>
       </MDBCardBody>
  </MDBCard>
</div>
        
        );
    }
}
export default Services;
